            }
            else
            {
                await Correcto();
            }
        }
    }

    private async Task<bool> Correcto()
    {

        ((Authorize)auth).Logeado(cedu);
        nav.NavigateTo("/");
        await sessionStorage.SetItemAsync("cedula", cedu);
        return await Task.FromResult(true);

    }

